import React from "react";
import './Main.css';

const Main = () => {
    return (
        <section className='Main'>
            <div className="overlay"> </div>
            <div className="backgroundImage" style={{ backgroundImage: "url('/background.jpg')" }}></div>
            <div className="mainContent container">
                <div className="cardDiv grid">
                    <span className="textDiv">Tìm kiếm chuyến đi</span>
                </div>
                <div class="banner">
                    <div class="container">
                        <div class="text-box">Text Box 1</div>
                        <div class="text-box">Text Box 2</div>
                        <div class="text-box">Text Box 3</div>
                        <button class="action-button">Click Me</button>
                    </div>
                </div>
            </div>
        </section>
    );
}

export default Main;
